import React from 'react';
import { Grid } from '@material-ui/core';


export const Skills = ({lang,tools,role,level,id}) => {

    const langTools = [...lang,...tools];
 

    return (
        <Grid>
            {
                (langTools) 
                    ?
                        langTools.map(lang => 
                            
                            <span>{lang}</span>
                            )

                    :  ''
                            
            }
        </Grid>
    )
}
